"86769":{"id":"86769","name":"Ares","slug":"ares","original_title":"Ares","overview":"Para fazer parte da elite de Amsterdã, uma universitária ambiciosa entra para uma sociedade fechada sem saber do segredo terrível que lá se esconde.","first_air_date":"2020-01-17","episode_run_time":33,"vote_average":6.6,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Pieter Kuijpers"],"production_companies":["Pupkin"],"genres":["Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/gniQXfQuVwh3OlEGAlwlH6dRja8.jpg","poster_path":"https://image.tmdb.org/t/p/original/iVUiL32XmwQyba3EH2E3g77dXge.jpg","cast":["Jade Olieberg","Tobias Kersloot","Lisa Smit","Frieda Barnhard","Hans Kesting"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/926beXgWgeiraGQFsXa1Onxs3z6.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/926beXgWgeiraGQFsXa1Onxs3z6.jpg","air_date":"2020-01-17","episode_count":8,"overview":"Para fazer parte da elite de Amsterdã, uma universitária ambiciosa entra para uma sociedade fechada sem saber do segredo terrível que lá se esconde.","vote_average":7,"episodes":{"1":{"name":"Episódio 1","overview":"Rosa, uma universitária ambiciosa e inteligente com uma vida difícil, é convidada a participar de uma sociedade exclusiva e misteriosa.","air_date":"2020-01-17","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/9sfKCB1NMFWnZwz5VlqZ3CEEhD.jpg","vote_average":7},"2":{"name":"Episódio 2","overview":"Rosa passa por um ritual de iniciação difícil e aterrador. Um dos novatos desaparece e os líderes da Ares ficam em alerta.","air_date":"2020-01-17","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/ncHwA0rP8oVm2iAX2m9YQSP2OUs.jpg","vote_average":7},"3":{"name":"Episódio 3","overview":"Rosa encara responsabilidades conflitantes e Jacob se submete a um interrogatório. Fleur convida Rosa para uma festa na qual os destinos parecem estar selados.","air_date":"2020-01-17","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/3ifsdLkDPJvCOLQgMjpzHKpnHjB.jpg","vote_average":7},"4":{"name":"Episódio 4","overview":"Os líderes da Ares tomam medidas drásticas para esconder a nefasta descoberta de Rosa. O tormento de Jacob piora.","air_date":"2020-01-17","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/v7Mtr9Ei62ZwkAu0iKyyBTH7Lxx.jpg","vote_average":7},"5":{"name":"Episódio 5","overview":"Arnold cruza com uma presença de seu passado. Rosa tem uma desavença com uma rival. Jacob faz uma previsão difícil de desvendar.","air_date":"2020-01-17","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/8cyA1BEvAmbGXMlzOdIy748yMZq.jpg","vote_average":7},"6":{"name":"Episódio 6","overview":"Fleur reage à morte de uma pessoa muito próxima. Rosa tenta se reaproximar da família, mas Carmen revela uma verdade impactante.","air_date":"2020-01-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dy0sGQPXAQoDHA8cy0cUiqtMFNb.jpg","vote_average":7},"7":{"name":"Episódio 7","overview":"Maurits avalia quem deve assumir a presidência de Ares. Carmen passa por uma prova sádica. Rosa consegue surpreender Jacob.","air_date":"2020-01-17","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/zAHXyO0sgdjLGNeMAUYqfGRY2fl.jpg","vote_average":7},"8":{"name":"Episódio 8","overview":"Carmen faz um alerta desesperado a Rosa. As coisas chegam a um final explosivo em Ares e um segredo terrível finalmente é revelado.","air_date":"2020-01-17","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/iAUJWxdoSRucyAgv06et0rsm0u9.jpg","vote_average":7}}}}},
