"126397":{"id":"126397","name":"Mark Ronson e a Evolução do Som","slug":"mark-ronson-e-a-evolucao-do-som","original_title":"Watch the Sound with Mark Ronson","overview":"Vencedor do Oscar® e GRAMMY, o DJ, produtor e compositor Mark Ronson brilha nesta série sobre inovação musical e tecnologia ao lado de grandes nomes como Paul McCartney, DJ Premier, Charli XCX, Dave Grohl e Questlove.","first_air_date":"2021-07-30","episode_run_time":0,"vote_average":7.4,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Morgan Neville"],"production_companies":["Tremolo Productions"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/jirREMOVVoRbBgZS3n6VDhXMMlb.jpg","poster_path":"https://image.tmdb.org/t/p/original/2dQx58qSH7yMW46RAZcKClkjjlK.jpg","cast":["Mark Ronson"],"trailer":"-PRU_kM265A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/2dQx58qSH7yMW46RAZcKClkjjlK.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/2dQx58qSH7yMW46RAZcKClkjjlK.jpg","air_date":"2021-07-30","episode_count":6,"overview":"N/A","vote_average":7.9,"episodes":{"1":{"name":"Auto-Tune","overview":"Mark, T-Pain e Charli XCX discutem sobre Auto-Tune, também conhecida como “tristeza robótica”, o acidente musical que se tornou um poderoso divisor de águas.","air_date":"2021-07-30","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/i0dCDdtxaZIH3Wxrp5ENYpdW77X.jpg","vote_average":7.5},"2":{"name":"Samplear","overview":"O debate continua: samplear é uma homenagem ou é apropriação? Só há uma certeza: precisa ser algo inovador. Mark, Paul McCartney e DJ Premier discutem a respeito.","air_date":"2021-07-30","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/kejfrupJgv0Dq3VnLCpOvXK2BOK.jpg","vote_average":7.7},"3":{"name":"Reverb","overview":"Trabalhar com Amy Winehouse foi o início da jornada emocional de Mark com a reverberação. Hoje, ele viaja ao redor do mundo para revelar o seu potencial infinito.","air_date":"2021-07-30","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/1Bjmys4FMrDVCyKCDFZAfOQWGRt.jpg","vote_average":8.3},"4":{"name":"Sintetizador","overview":"Mark celebra os inovadores e outsiders que aproveitaram a potência dos sintetizadores, e compartilha do amor de Kevin Parker (Tame Impala) pelo seu som.","air_date":"2021-07-30","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/fEEDGwjdhPBcjRT6NK1RxQpddq3.jpg","vote_average":7.7},"5":{"name":"Bateria eletrônica","overview":"GIMME A BEAT!” Da Linn drum até a 808, Mark, Questlove e Too $hort acompanham a evolução dos aparelhos que criaram o hip-hop.","air_date":"2021-07-30","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/kKJ6i9anjQFmqXuKWyAfh8GhBr0.jpg","vote_average":8},"6":{"name":"Distorção","overview":"Mark e Santigold falam sobre distorção, o som rebelde da quebra de regras, e comentam sobre os pioneiros que a usaram para abalar a cultura.","air_date":"2021-07-30","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/gSvqYWGQqagehAhokhORuekLSMh.jpg","vote_average":8}}}}},
"130119":{"id":"130119","name":"João de Deus: Cura e Crime","slug":"joao-de-deus-cura-e-crime","original_title":"João de Deus: Cura e Crime","overview":"O idolatrado médium João de Deus alcança fama internacional, até que sobreviventes, procuradores e a mídia começam a denunciar seus abusos. Nesta série documental, vamos mergulhar por meio de entrevistas exclusivas e materiais inéditos, na tenebrosa trajetória de João de Deus, o líder de cirurgias espirituais e dono de um império econômico que se tornou protagonista do maior escândalo de assédio sexual do Brasil.","first_air_date":"2021-08-25","episode_run_time":50,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":[],"genres":["Documentário","Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/5fpjUdAglxI4jFA2W8fE5EDAAJW.jpg","poster_path":"https://image.tmdb.org/t/p/original/kQaj9ZMRLW7n6qLIpTiBk748MIU.jpg","cast":["Andrea Mannelli","Rejane Araújo","Jardel Wagner","Norberto Kist","Angela Homercher"],"trailer":"Sgnpy4X3pzc","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/5AZWlyW0Y2ypReECBMMAAJVxc2q.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/5AZWlyW0Y2ypReECBMMAAJVxc2q.jpg","air_date":"2021-08-25","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"O Curador","overview":"Relatos de milagres atraem milhares de pessoas para a casa de Abadiânia, em Goiás. Alguns saem de lá \"curados\", enquanto outros são marcados para sempre.","air_date":"2021-08-25","runtime":50,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"O Escândalo","overview":"Os lucros e a influência aumentam, mas as acusações contra João de Deus atrapalham os planos de expansão da marca e dos negócios.","air_date":"2021-08-25","runtime":51,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"O Processo","overview":"Incentivadas pelas denúncias contra \"João de Deus\", as sobreviventes se unem para processar o abusador.","air_date":"2021-08-25","runtime":56,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Justiça?","overview":"A filha de João revela sua história de abuso e manipulação. Chega a hora do ajuste de contas para \"João de Deus\", e as sobreviventes tentam seguir em frente.","air_date":"2021-08-25","runtime":48,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
