"104819":{"id":"104819","name":"A Matilha","slug":"a-matilha","original_title":"La Jauría","overview":"Um esquadrão policial especializado em crimes de gênero enfrentará forças desconhecidas e o status quo da elite econômica para desmontar uma rede de poder misógina que opera a partir da Deep Web com um único objetivo: atingir e prejudicar mulheres.","first_air_date":"2020-07-10","episode_run_time":0,"vote_average":7.3,"number_of_seasons":2,"number_of_episodes":16,"created_by":["Enrique Videla","Sergio Castro San Martín"],"production_companies":["Fabula","Kapow","Fabula"],"genres":["Drama","Crime"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/jEsk7GaguUVoxO8nTBFa1QsS8ja.jpg","poster_path":"https://image.tmdb.org/t/p/original/iRZX9p0miSsBVV7eBgH0HSjnmE2.jpg","cast":["María Gracia Omegna","Antonia Zegers","Daniela Vega","Paula Luchsinger","Luis Gnecco"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/bwB4Ea4YayHgcNxT8JeYyu417Zs.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/bwB4Ea4YayHgcNxT8JeYyu417Zs.jpg","air_date":"2020-07-10","episode_count":8,"overview":"N/A","vote_average":6.9,"episodes":{"1":{"name":"Respire Fundo","overview":"Uma denúncia de abuso sexual em uma escola de área rica de Santiago, Chile, mexe com todos.","air_date":"2020-07-10","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/2DgRe2g4gAEvk7rqOcwTanV04CE.jpg","vote_average":7},"2":{"name":"Vamos à caçada","overview":"Murillo e Olivia chegam perigosamente perto de “el lobo”, graças à ajuda de Celeste nas sombras; mas isso não vai sair de graça e põe em perigo até as próprias detetives.","air_date":"2020-07-10","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/syOlyFZGExCShxUVnd9xODMg2ue.jpg","vote_average":7.5},"3":{"name":"Gente com dinheiro, gente com poder","overview":"No meio da investigação e da ansiedade para encontrar a filha, Bruno revela a Fernández e à esposa uma verdade oculta da desaparecida Blanca.","air_date":"2020-07-10","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/fHT4KKueoNtoiYL0VNGSvxlxKT0.jpg","vote_average":7.5},"4":{"name":"Deixem minha marca","overview":"O destino de Ossandón coloca sob desconfiança os métodos da polícia para descobrir o paradeiro de Blanca; os pais, dando as costas para a investigação, oferecem uma recompensa em troca de informação.","air_date":"2020-07-10","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/pHqROW6LPV72qBFTBZCdOaehb7C.jpg","vote_average":7},"5":{"name":"Lobos contra leoas","overview":"“O lobo” não tem escrúpulos e, tal como na vida selvagem, é mais eficaz e mortal na matilha. Olivia e toda a equipe de investigação são marcados pelo obscuro jogo online, demonstrando que estão dispostos a tudo para realizar a missão.","air_date":"2020-07-10","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/f7slDPkqqwHDn8E2x6XwaK0HOJ3.jpg","vote_average":6.5},"6":{"name":"O jogo não terminou","overview":"Um animal de caça encurralado para se converter em presa é errático e imprevisível. Seguido pela polícia, \"o lobo\" faz uso dos últimos recursos para se safar com vida.","air_date":"2020-07-10","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/whEtq9RDz0scXKK6O3ZOmsnaWsK.jpg","vote_average":7},"7":{"name":"Às vezes é bom que doa","overview":"As três detetives estão a ponto de encontrar o lobo alfa por trás das matilhas, mas para ele devem aparecer como uma matulha de mulheres dispostas a mostrar os dentes.","air_date":"2020-07-10","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/6bu6lWHW5pquHqN4fOlI60dgBnp.jpg","vote_average":6.5},"8":{"name":"Nunca disse o seu nome","overview":"O alfa da matilha é um lobo em pele de cordeiro, e Olivia Fernández acaba de desco+E3brir quem é. Em uma corrida contra o tempo para resgatar a parceira, que agora está nas mãos de uma fera insaciável, a detetive colocará a própria vida em risco.","air_date":"2020-07-10","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/cdINpwO3Bjqvnr8nqpxWCUjwYMy.jpg","vote_average":6.5}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/iRZX9p0miSsBVV7eBgH0HSjnmE2.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/iRZX9p0miSsBVV7eBgH0HSjnmE2.jpg","air_date":"2022-04-22","episode_count":8,"overview":"N/A","vote_average":8.3,"episodes":{"1":{"name":"Episódio 1","overview":"N/A","air_date":"2022-04-22","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/cfJYjLkF30IRsJ4IGoqf1BZBo4R.jpg","vote_average":8},"2":{"name":"Episódio 2","overview":"N/A","air_date":"2022-04-22","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/xpqGagEVJnUhEFIQkhptE0qZouc.jpg","vote_average":8},"3":{"name":"Episódio 3","overview":"N/A","air_date":"2022-04-22","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/87mfSr7rvXyNWXkBeJe9R59X5Nc.jpg","vote_average":8},"4":{"name":"Episódio 4","overview":"N/A","air_date":"2022-04-22","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/11gIzCAFeM4DWmHuAQhCiJsw2aC.jpg","vote_average":7},"5":{"name":"Episódio 5","overview":"N/A","air_date":"2022-04-22","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/kTfCzAWE0n3vqXRDUz0MjL1ZQqX.jpg","vote_average":8},"6":{"name":"Episódio 6","overview":"N/A","air_date":"2022-04-22","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/2FCi4yqil5fiwe1EOSPNm36b5z5.jpg","vote_average":9},"7":{"name":"Episódio 7","overview":"N/A","air_date":"2022-04-22","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/keuwMRwwy1g1TMSa5W0oS2ntmnN.jpg","vote_average":9},"8":{"name":"Episódio 8","overview":"N/A","air_date":"2022-04-22","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/qNeYcoraOYmSx8tvduV2NpqAdC5.jpg","vote_average":9}}}}},
