"127626":{"id":"127626","name":"Como Se Tornar um Tirano","slug":"como-se-tornar-um-tirano","original_title":"How to Become a Tyrant","overview":"Para governar com mão de ferro, é preciso conhecer muito bem o jogo do poder absoluto, como mostram os infames ditadores apresentados nesta série documental.","first_air_date":"2021-07-09","episode_run_time":30,"vote_average":7.363,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":[],"genres":["Documentário","War & Politics"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/9aKLfKx3QDGdzGuLw4GJDKtxsF0.jpg","poster_path":"https://image.tmdb.org/t/p/original/tn7XGVltyp22fqIEAy8s0Momm6l.jpg","cast":["Peter Dinklage"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/tn7XGVltyp22fqIEAy8s0Momm6l.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/tn7XGVltyp22fqIEAy8s0Momm6l.jpg","air_date":"2021-07-09","episode_count":6,"overview":"N/A","vote_average":7,"episodes":{"1":{"name":"Tome o poder","overview":"Quer tornar-se um tirano? Existem regras a seguir. O manual de ascensão à ditadura começa com um dos déspotas mais brutais da História: Adolf Hitler.","air_date":"2021-07-09","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/7cF9BCdvnQHVZUEbaj8IWtAegsh.jpg","vote_average":7},"2":{"name":"Acabe com os rivais","overview":"Você já está no topo, mas manter o poder significa estar sempre alerta. Ninguém fez isso melhor ou mais cruelmente do que Saddam Hussein.","air_date":"2021-07-09","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/vowOPtHSuHGQq2yXXF1s1Ypqe9e.jpg","vote_average":7},"3":{"name":"Reine pelo terror","overview":"Para manter o povo sob controle, é melhor ser amado ou temido? Idi Amin com certeza achou que sabia a resposta certa.","air_date":"2021-07-09","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/2Yt12aAf33Qfy5nVQa4gG9tMNW1.jpg","vote_average":7},"4":{"name":"Controle a verdade","overview":"Com truques de relações públicas, revisionismo histórico e censura, o autocrata soviético Josef Stalin transformou a verdade em desinformação e propaganda.","air_date":"2021-07-09","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/puL0SqVUUTujER7RPUbmXwCOtih.jpg","vote_average":7},"5":{"name":"Crie uma nova sociedade","overview":"Para o ex-rebelde que virou ditador Muammar Gaddafi, a liberdade de expressão e o direito de se reunir são empecilhos para mudar a sociedade.","air_date":"2021-07-09","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/58aOUlYMisOfDpD7mHpEXQ6Yybr.jpg","vote_average":7},"6":{"name":"Governe para sempre","overview":"Tomar o poder não é fácil, mas mantê-lo é ainda mais difícil. Na Coreia do Norte, a dinastia Kim encontrou a solução: eles se declararam deuses.","air_date":"2021-07-09","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/u5H5Ytie9LMXd06gQUM5rztfUDx.jpg","vote_average":7}}}}},
