"137094":{"id":"137094","name":"Love to Hate You","slug":"love-to-hate-you","original_title":"연애대전","overview":"Para uma mulher que detesta perder para os homens e para um homem que não confia nas mulheres, o amor é uma guerra. Qual é o limite entre o amor e o ódio?","first_air_date":"2023-02-10","episode_run_time":54,"vote_average":8.2,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Kim Jeong-kwon","Choi Soo-young"],"production_companies":["Binge Works"],"genres":["Drama","Comédia"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/ur7Z7E6t1B6fWMreXNMpsUTcBGX.jpg","poster_path":"https://image.tmdb.org/t/p/original/sh8T8DsHMqqy2R1cgSdHw7iY7AM.jpg","cast":["김옥빈","Teo Yoo","김지훈","고원희","Kim Sung-ryung"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/kbfcnflR4FnfxvSnXR536V4FMUB.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/kbfcnflR4FnfxvSnXR536V4FMUB.jpg","air_date":"2023-02-10","episode_count":10,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"Garota má","overview":"A aversão de Yeo Mi-ran por homens mesquinhos e mulherengos só aumenta. Nam Kang-ho ofende uma colega no set de filmagem.","air_date":"2023-02-10","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/eSWsTJkLqdnx0BgQ3u3TsgAopHh.jpg","vote_average":6},"2":{"name":"Garoto mau","overview":"Mi-ran começa em um novo escritório, onde é a primeira mulher a ser contratada. Ela precisa lidar com uma cliente importante, um ex-namorado e um desafeto.","air_date":"2023-02-10","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/cN5sm6K26B2UvK4BdcepX6gwpBi.jpg","vote_average":0},"3":{"name":"Caras legais ganham passe, os maus passam fora","overview":"Depois de pegar Kang-ho em uma situação aparentemente comprometedora, Mi-ran resolve se aproximar dele para fazer justiça.","air_date":"2023-02-10","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/erKVfe5H5hBmsZU28HDyTa0lSQ7.jpg","vote_average":0},"4":{"name":"Você não é o que eu esperava","overview":"Na preparação para o papel dos seus sonhos, Kang-ho pede ajuda a Mi-ran. Uma antiga paixão reaparece.","air_date":"2023-02-10","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/sFsxL2oZL9sLqGicFKKgu4VZh6o.jpg","vote_average":0},"5":{"name":"O amor é só uma experiência, a vida real é o que vale","overview":"Mi-ran recebe uma investida indesejada que inclui uma complicada surpresa de aniversário. Boatos ameaçam a reputação de Kang-ho.","air_date":"2023-02-10","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/lqhWh4sgLXYPdTqW1WG20Jt4hXh.jpg","vote_average":0},"6":{"name":"Femme fatale versus homme fatale","overview":"Para acabar com os rumores, Kang-ho e Mi-ran começam um romance falso. Do Won-jun conhece a colega de quarto de Mi-ran.","air_date":"2023-02-10","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/dsFRLwn8EeP1NwCkvkYxZKSpYyj.jpg","vote_average":0},"7":{"name":"Trigonometria: versão triângulo amoroso","overview":"As coisas começam a ficar um pouco mais sérias entre Mi-ran e Kang-ho. Mesmo sabendo do suposto status de relacionamento de Kang-ho, Oh Se-na tenta reconquistá-lo.","air_date":"2023-02-10","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/mXA9JVJKlFc73Ulx8mmwB08XgRV.jpg","vote_average":0},"8":{"name":"Você me faz mudar","overview":"Quando Mi-ran se machuca, Kang-ho percebe seus sentimentos por ela. Won-jun e Shin Na-eun flertam com uma parceria e um com o outro.","air_date":"2023-02-10","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/jtVJaRokEKREcR5DnPZnPawgb2C.jpg","vote_average":0},"9":{"name":"Eu sou assim por sua causa","overview":"Mi-ran e Kang-ho abrem o coração um para o outro. Com a objetivo de superar sua paixão por Won-jun, Na-eun compartilha com ele seus hábitos mais vergonhosos.","air_date":"2023-02-10","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/wFpRhUApA2V0C7HRVwsILghS9rs.jpg","vote_average":0},"10":{"name":"Um adeus apaixonado","overview":"Todos se afastam de Mi-ran depois que notícias sobre sua vida amorosa se espalham. Ela e Kang-ho sentem a pressão. Será que o amor vai vencer?","air_date":"2023-02-10","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/d9g65WJCNIE3IHLlmAcdfLqpAlA.jpg","vote_average":0}}}}},
