"281679":{"id":"281679","name":"A História da Minha Família","slug":"a-historia-da-minha-familia","original_title":"Storia della mia famiglia","overview":"Com uma doença terminal, um pai prepara a família caótica para cuidar de seus filhos e encarar a vida sem ele. Mas antes, todos precisam deixar as diferenças de lado.","first_air_date":"2025-02-19","episode_run_time":0,"vote_average":6.786,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Filippo Gravino"],"production_companies":[],"genres":["Drama","Comédia"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/renyXumdrJNBrQZo7UEWxL0Lkdr.jpg","poster_path":"https://image.tmdb.org/t/p/original/e6bcTQjI1Whkhk4UkrDKaFMKpnK.jpg","cast":["Eduardo Scarpetta","Vanessa Scalera","Massimiliano Caiazzo","Cristiana Dell'Anna","Gaia Weiss"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/h6Rga3B6xVlfaNZ7ZvqckugycKl.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/h6Rga3B6xVlfaNZ7ZvqckugycKl.jpg","air_date":"2025-02-19","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Fausto","overview":"Fausto prepara a família caótica e nada convencional para a vida sem ele. Em 2011, ele conhece Sarah e o mundo deles muda para sempre.","air_date":"2025-02-19","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/mwsonUqaUOjwDfRAuNaHLMUTY41.jpg","vote_average":0},"2":{"name":"Lucia","overview":"A família lida com a dor e os últimos desejos de Fausto para o futuro das crianças. Em 2012, Sarah tem dificuldades com os primeiros momentos marcantes do relacionamento.","air_date":"2025-02-19","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/154ijh02Kevo479CsCIoWjCsmcC.jpg","vote_average":0},"3":{"name":"Demetrio","overview":"As gravações de Fausto ajudam a família a ficar unida pelas crianças e dão um empurrãozinho em Demetrio, que em 2012 se recuperou de uma fase difícil com apoio do amigo.","air_date":"2025-02-19","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/b7x9AVaRTuaWYkGFT1QlIero6rn.jpg","vote_average":0},"4":{"name":"Valerio","overview":"Um novo amigo peludo se junta à família. Libero anda misterioso. Em 2018, Fausto e Sarah vivem uma crise, e Valerio só piora as coisas.","air_date":"2025-02-19","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/hhJTqxwZfN9yiEE2cVSi08M8sVP.jpg","vote_average":0},"5":{"name":"Maria","overview":"Sarah conversa com a família antes da apresentação das crianças. Em 2022, Fausto e Maria se reencontram justamente quando ele mais precisa.","air_date":"2025-02-19","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/ihmCOGzIgLb5cWTi3KbV37OzwRx.jpg","vote_average":0},"6":{"name":"Nossa vida","overview":"A família viaja para o interior enquanto aguarda a decisão do juiz sobre a custódia das crianças. Em 2023, Fausto tenta negociar uma trégua com Sarah.","air_date":"2025-02-19","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/sqSodKNWNiDEpYzoIhduw4IpeL1.jpg","vote_average":0}}}}},
